  false,\n\t\"url\": null,\n\t\"notes\": \"The Western Alaska Community Development
  Quota (CDQ) Program allocates a percentage of all Bering Sea and Aleutian Islands
  quotas for groundfish, prohibited species, halibut, and crab to eligible communities.
  The purpose of the CDQ Program is to provide the means for starting or supporting
  commercial fisheries business activities that will result in an ongoing, regionally
  based, fisheries-related economy in Western Alaska.  This was the legacy system
  for managing CDQ Groundfish from 1991-2007. After 2008, CDQ groundfish was incorporated
  into the Catch Accounting System.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
